        <div className="Person">
            <h3>Hello my name is {name}, Im {age} years old!</h3>
            <p>{props.children}</p>
            {/* <p>la key es {key}</p> */}
            <button onClick={props.onChangePerson}>Change person</button>
        </div>
    )
}

export default Person;
